import React from 'react'
import Footer from '../components/Footer';
import Header from '../components/Header'

const Resume = () => {
    return (
        <div>
            <Header/>
            <div className='resume'>
            <h1>Resume</h1>
                <div className='resume2'>
                    <h3>Work</h3>
                    <h3>Experience</h3>
                </div>
                    <div className='resume3'></div>
            </div>
            <Footer/>
        </div>
    );
};

export default Resume;
